import React from 'react';
import './header.css';
import Emblem from '../../../media/logo-img.png';
import {Container, Row, Col, Image} from 'react-bootstrap';
import Wave from 'react-wavify'

function header() {
    return (
        <>
        <header className = "header d-flex align-items-end justify-content-center" id = "home">
            <Container>
                <Row>
                    <Col className = "pt-5 d-flex justify-content-center mt-5">
                        <Image src = {Emblem} fluid></Image>
                    </Col>
                </Row>   
            </Container>  
        </header>
        <Container className = "wave-container px-0" fluid>
            <Wave className = "wave" fill='#47CFFF' options={{height: 5, amplitude: 15, speed: 0.20, points: 3}}></Wave>
            <Wave className = "wave" fill='#00B0F0' options={{height: 7, amplitude: 15, speed: 0.20, points: 3}}></Wave>
            <Wave className = "wave" fill='#21242C' options={{height: 40, amplitude: 20, speed: 0.15, points: 5}}></Wave>
        </Container>
        </>
    )
}

export default header
